import React, { Component } from "react";
import Navbarr from "../Navbar/Navbar";
import m2 from "../../assets/m2.jpg";
import m4 from "../../assets/m4.jpg";
import m3 from "../../assets/m3.jpg";
import m1 from "../../assets/m1.jpg";
import Serverservice from "../../Services/Serverservice";
import "../Home/Home.css";
export default class Yourevents extends Component {
  state = {
    events: [],
  };
  componentDidMount() {
    const data = {
      id: localStorage.getItem("id"),
    };
    Serverservice.getyourevents(data)
      .then((response) => {
        console.log(response);
        this.setState({
          events: response.data.events,
        });
        console.log(this.state.events);
      })
      .catch((err) => {
        console.log(err.response);
      });
  }
  render() {
    return (
      <div>
        <Navbarr />
        <div class="project" style={{ width: "100%" }}>
          {this.state.events.map((data) => {
            return this.state.events.map((data) => {
              return (
                <a href="#abhay">
                  <div>
                    <div class="card">
                      <img src={m1} alt="Avatar" style={{ width: "100%" }} />
                    </div>
                    <div className="mt-1 ml-2">
                      <h4 className="text-dark">abhy</h4>
                      <p className="text-muted">Drama</p>
                    </div>
                  </div>
                </a>
              );
            });
          })}
        </div>
        <ul>{}</ul>
      </div>
    );
  }
}
